value.raw:
display: flex;
flex-direction: column;
align-items: center;

value.cooked:
display: flex;
flex-direction: column;
align-items: center;

value.raw:
query getTodaysInvoices($start: DateTime!, $locationId: ID) {
  posted: orders(
    invoiced: true
    posted: true
    invoicedBy: $start
    locationId: $locationId
  ) {
    id
    total
  }
  invoiced: orders(
    invoiced: true
    posted: false
    invoicedBy: $start
    locationId: $locationId
  ) {
    id
    total
  }
  drafted: orders(
    invoiced: false
    posted: false
    start: $start
    locationId: $locationId
  ) {
    id
    total
    client {
      id
      name
    }
    patients {
      id
      name
    }
  }
  open: orders(invoiced: false, posted: false, locationId: $locationId) {
    ...OrderRowInfo
    client {
      id
      name
      patients {
        id
        updatedAt
      }
    }
  }
}

